import { AppBar, Toolbar } from '@mui/material'
import { styled } from '@mui/system'
import React from 'react'

const StyledToolBar = styled(Toolbar) 


const Navbar = () => {
  return (
    <>
        <AppBar position="sticky">
            <Toolbar>
                Navabar
            </Toolbar>
        </AppBar>
    </>
  )
}

export default Navbar
